import React from "react";
import { useState } from "react";
import '../style.css';
function Dashboard(){
    const [state,setState]=useState(
        {
            selectedOption:"dashboard"
        }
    );
    function handleClick(e){
        
        var incoming=e.target.getAttribute("name");
        if(incoming==="a"){
            setState({selectedOption:"dashboard"});
        }
        if(incoming==="b"){
            setState({selectedOption:"intake"});
        }
    }
    console.log(state.selectedOption);
    return(
        <>
            <div className="container-bg">
                <div className="left">
                    <div className="table-container">
                        <table >
                            <tr >
                                <td className={state.selectedOption==="dashboard"?"tr-left-selected":"tr-left"}
                                onClick={handleClick}
                                name="a">
                                    Dashboard
                                </td>
                            </tr>
                            <tr >
                                <td className={state.selectedOption==="intake"?"tr-left-selected":"tr-left"}
                                onClick={handleClick}
                                name="b">
                                    Intake
                                </td>
                            </tr>
                        </table>
                        
                    </div>
                </div>
                <div className="right">

                </div>
            </div>
        </>
    );
}
export default Dashboard;
